import * as React from 'react';
import './scrollButton.scss';

const ScrollButton: React.FC = () => {
  return (
    <div className={'scroll-button-wrapper'}>
      <p>Scroll om te lezen</p>
      <img src={require('../../assets/img/01.jpg')} alt="" />
    </div>
  );
};

export { ScrollButton };
